import React from "react";

function Box({
  id, 
  handleRemove, 
  BackgroundColor = "red",
  Height = 100, 
  Width = 100, 
}) {
  const remove = () => handleRemove(id);
  return (
    <div>
      <div 
        style={{
        BackgroundColor,
        Height: `${Height}px`,
        Width: `${Width}px`
      }}
      />
        <button onClick={remove}>Delete Box</button>
      </div>
  );
}

export default Box;
